import React, { useState, useEffect } from "react";
import axios from "axios";
import "./App.css";  // 保证样式文件正确引入

function App() {
  const [location, setLocation] = useState("");
  const [trafficCondition, setTrafficCondition] = useState("normal");
  const [incidentDetected, setIncidentDetected] = useState(false);
  const [vehicleSpeed, setVehicleSpeed] = useState("");
  const [loading, setLoading] = useState(false);
  const [responseMessage, setResponseMessage] = useState("");
  const [recentRecords, setRecentRecords] = useState([]); // 存储最近记录

  // 表单提交函数
  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setResponseMessage("");

    const data = {
      location,
      traffic_condition: trafficCondition,
      incident_detected: incidentDetected,
      vehicle_speed: vehicleSpeed,
    };

    try {
      const response = await axios.post(
        `${process.env.REACT_APP_API_URL}/events/autonomous_driving`,
        data
      );
      setResponseMessage(response.data.status);
    } catch (error) {
      setResponseMessage("Error: Could not complete the request.");
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    // WebSocket 连接
    const socket = new WebSocket(process.env.REACT_APP_WS_URL);

    socket.onopen = () => {
      console.log("WebSocket connected!");
    };

    socket.onmessage = (event) => {
      const message = JSON.parse(event.data);
      // 当接收到 WebSocket 消息时，更新最近记录
      if (message.type === "autonomous_driving") {
        setRecentRecords((prev) => [message, ...prev].slice(0, 5)); // 保留最近 5 条记录
      }
    };

    socket.onclose = () => {
      console.log("WebSocket disconnected");
    };

    return () => {
      socket.close(); // 清理 WebSocket 连接
    };
  }, []);

  return (
    <div className="App">
      <h1 className="app-title">自动驾驶 × 城市管理控制面板</h1>
      <form onSubmit={handleSubmit} className="task-form">
        <div className="form-group">
          <label>Location</label>
          <input
            type="text"
            value={location}
            onChange={(e) => setLocation(e.target.value)}
            placeholder="Enter location"
            required
            className="form-input"
          />
        </div>

        <div className="form-group">
          <label>Traffic Condition</label>
          <select
            value={trafficCondition}
            onChange={(e) => setTrafficCondition(e.target.value)}
            className="form-select"
          >
            <option value="normal">Normal</option>
            <option value="heavy">Heavy</option>
          </select>
        </div>

        <div className="form-group">
          <label>Incident Detected</label>
          <input
            type="checkbox"
            checked={incidentDetected}
            onChange={(e) => setIncidentDetected(e.target.checked)}
            className="form-checkbox"
          />
        </div>

        <div className="form-group">
          <label>Vehicle Speed (km/h)</label>
          <input
            type="number"
            value={vehicleSpeed}
            onChange={(e) => setVehicleSpeed(e.target.value)}
            placeholder="Enter speed"
            required
            className="form-input"
          />
        </div>

        <button type="submit" className="submit-btn" disabled={loading}>
          {loading ? "Loading..." : "Send"}
        </button>
      </form>

      {responseMessage && (
        <div className="response-message">
          <strong>Response:</strong> {responseMessage}
        </div>
      )}

      <div className="recent-records">
        <h2>最近记录</h2>
        <ul>
          {recentRecords.map((record, index) => (
            <li key={index} className={`record-item ${record.payload.traffic_condition.toLowerCase()}`}>
              <span className="record-title">{record.title}:</span> {JSON.stringify(record.payload)}
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default App;
